## Remarks  
 <span data-ttu-id="2dba4-102">Jest podtypem, którego można użyć do dołączenia <xref:System.ServiceModel.Description.WebHttpBehavior> do punktu końcowego za pomocą konfiguracji. <xref:System.ServiceModel.Configuration.BehaviorExtensionElement> <xref:System.ServiceModel.Configuration.WebHttpElement></span><span class="sxs-lookup"><span data-stu-id="2dba4-102">The <xref:System.ServiceModel.Configuration.WebHttpElement> is a <xref:System.ServiceModel.Configuration.BehaviorExtensionElement> sub-type that can be used to include the <xref:System.ServiceModel.Description.WebHttpBehavior> on an endpoint through configuration.</span></span> <span data-ttu-id="2dba4-103">Zachowanie <xref:System.ServiceModel.Description.WebHttpBehavior> , które jest używane w połączeniu <xref:System.ServiceModel.WebHttpBinding> z powiązaniem, włącza model programowania sieci Web dla usługi Windows Communication Foundation (WCF).</span><span class="sxs-lookup"><span data-stu-id="2dba4-103">The <xref:System.ServiceModel.Description.WebHttpBehavior> behavior, when used in conjunction with the <xref:System.ServiceModel.WebHttpBinding> binding, enables the Web programming model for a Windows Communication Foundation (WCF) service.</span></span> <span data-ttu-id="2dba4-104">Należy zauważyć, <xref:System.ServiceModel.Web.WebServiceHost> że automatyczne dodanie tego zachowania do punktów końcowych <xref:System.ServiceModel.WebHttpBinding>, które używają.</span><span class="sxs-lookup"><span data-stu-id="2dba4-104">Note that the <xref:System.ServiceModel.Web.WebServiceHost> automatically adds this behavior to endpoints that use the <xref:System.ServiceModel.WebHttpBinding>.</span></span>  
  
   
  
## Examples  
 <span data-ttu-id="2dba4-105">Ten przykład zwraca typ <xref:System.ServiceModel.Configuration.WebHttpElement>.</span><span class="sxs-lookup"><span data-stu-id="2dba4-105">This sample returns the type <xref:System.ServiceModel.Configuration.WebHttpElement>.</span></span>  
  
```  
using System;  
using System.ServiceModel;  
using System.ServiceModel.Web;  
using System.ServiceModel.Configuration;  
  
    class Program  
    {  
        static void Main(string[] args)  
        {  
            WebHttpElement webHttpElement = new WebHttpElement();  
            Console.WriteLine("The type is: {0}", webHttpElement.BehaviorType);  
            Console.WriteLine("Press <ENTER> to terminate the program.");  
            Console.ReadLine();  
        }  
    }  
```

  
  
